import React from 'react'
// import { useDispatch } from 'react-redux'
import {Link} from 'react-router-dom'
// import { getInfo } from '../actions'
import axios from 'axios'



function Card({img, title, diets, id}) {
    let probanding = async() => {
        let a = await axios.get('https://api.spoonacular.com/recipes/complexSearch?apiKey=1cd37c79cab847bf8c2dea97c3abda7e&number=100&addRecipeInformation=true')
        a = a.data.results;
        a = a.map(e=> e.diets)
        let b = new Set(a)
        b = [...b];
        return b;

    }

    let x = probanding();
    console.log(x);

    return (
         <div>
            {
            <div>
                <img src={img} alt="img not found" />
                <Link to ={{
                    pathname: '/Home/detail',
                    search: `${id}`
            }}>
                <h1>{title}</h1>
                </Link>
                {diets.map((diet, index)=> <li key={index}>{diet}</li>)}
                <hr />
            </div>
            }
        </div>

    )
}

export default Card
